import React from 'react';




export class MoviesList extends React.Component {
//binds passed handler to StreamsList handler
  constructor(props){
    super(props)

    this.state={
      result:'',
    };    
  }

  componentDidMount() {
  }

  render() {   
      if (this.props.movie.slug.includes(this.props.search)){
        return (
          <div className="moiveCard">
            <h1> {this.props.movie.slug} </h1>
          </div>
        )
      }
      else{
        return(
          this.state.result
        )
      }
      return (
        <div className="moiveCard">
          <h1> {this.props.movie.slug} </h1>
        </div>
      )      
  }

}

export default MoviesList;
